import React from "react";
import { Nav } from "react-bootstrap";
const Footer = () => {
  return (
    <footer>
      <div className="bg-dark text-white  p-30px 20px"style={{ fontSize: "2vw" }}>
        The Generics
        <div>
          <Nav.Link href="https://www.youtube.com">
            <i class="fa-brands fa-youtube" style={{ color: "#e60f0f" }}></i>
          </Nav.Link>
          <Nav.Link href="https://www.facebook.com"><i class="fa-brands fa-facebook"></i></Nav.Link>
          <Nav.Link href="https://www.amazon.com">Pricing</Nav.Link>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
